🚨 ALERTE COUP DE COEUR #i.FIV5 @MaisonSimons 
Nouvelle année veut aussi dire nouveaux ensembles d’entraînement dans ma garde-robe 😏

Timing parfait ! Je viens de découvrir la marque de vêtements i.FIV5 offerte en exclusivité chez @MaisonSimons et je suis tombé en amour littéralement😍 Chaque pièce est super tendance, à empreinte écologique réduite & méga confortable. Vraiment dans ma palette de goûts de A à Z !

Pour la plupart des morceaux, ils font partie du programme Vision♻️ chez Simons qui allie style, fonctionnalité & durabilité et je confirme que chaque ensemble coche chacun de ces critères.

En terme de vêtements de sport, je crois être une bonne référence et croyez-moi les filles, chacun de ces ensemble mérite d’être dans votre garde-robe aussi 🛍️ Bon magasinage!

